import React from 'react';
import Questions from './components/Questions';

function App() {
  var state = {
    questions: [
      {
        id: 1,
        text: "Do you like things?",
        answered: false
      },
      {
        id: 2,
        text: "Do you hate things?",
        answered: false
      }
    ]
  }
  console.log(state.questions)
  return (
    //console.log(this.state.questions)
    <div className="App">
      <Questions />
    </div>
  );
}

export default App;
